-- ----------------------------
-- View structure for `existencias`
-- ----------------------------
DROP VIEW IF EXISTS `existencias`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `existencias` AS select `p`.`cla_pro` AS `cla_pro`,`cb`.`F_Cb` AS `cb`,`p`.`des_pro` AS `des_pro`,`dp`.`lot_pro` AS `lot_pro`,`dp`.`cad_pro` AS `cad_pro`,`dp`.`id_ori` AS `id_ori`,`i`.`cant` AS `cant`,`p`.`f_status` AS `f_status` from (((`productos` `p` join `detalle_productos` `dp`) join `inventario` `i`) join `tb_codigob` `cb`) where ((`p`.`cla_pro` = `dp`.`cla_pro`) and (`dp`.`det_pro` = `i`.`det_pro`) and (`dp`.`cla_pro` = `cb`.`F_Clave`) and (`dp`.`lot_pro` = `cb`.`F_Lote`) and (`dp`.`cad_pro` = `cb`.`F_Cadu`)) ;

-- ----------------------------
-- View structure for `receta_reportes`
-- ----------------------------
DROP VIEW IF EXISTS `receta_reportes`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `receta_reportes` AS (select `u`.`cla_uni` AS `cla_uni`,`u`.`des_uni` AS `des_uni`,`r`.`id_rec` AS `id_rec`,`r`.`fol_rec` AS `fol_rec`,`r`.`id_tip` AS `id_tip`,`r`.`cedula` AS `cedula`,`m`.`nom_com` AS `medico`,`pa`.`num_afi` AS `num_afi`,`pa`.`nom_com` AS `nom_com`,`p`.`cla_pro` AS `cla_pro`,`p`.`des_pro` AS `des_pro`,`p`.`amp_pro` AS `amp_pro`,`p`.`pres_pro` AS `pres_pro`,`cm`.`present` AS `present`,`dp`.`lot_pro` AS `lot_pro`,`dp`.`cad_pro` AS `cad_pro`,`dr`.`can_sol` AS `can_sol`,`dr`.`cant_sur` AS `cant_sur`,`o`.`des_ori` AS `des_ori`,`dp`.`id_ori` AS `id_ori`,`r`.`fecha_hora` AS `fecha_hora`,`p_a`.`cant` AS `amp`,(`dr`.`cant_sur` DIV `p_a`.`cant`) AS `cantidad` from ((((((((((`unidades` `u` join `usuarios` `us`) join `receta` `r`) join `detreceta` `dr`) join `detalle_productos` `dp`) join `productos` `p`) join `pacientes` `pa`) join `origen` `o`) join `medicos` `m`) join `pasti_ampu` `p_a`) join `clave_med` `cm`) where ((`u`.`cla_uni` = `us`.`cla_uni`) and (`us`.`id_usu` = `r`.`id_usu`) and (`r`.`id_pac` = `pa`.`id_pac`) and (`m`.`cedula` = `r`.`cedula`) and (`r`.`id_rec` = `dr`.`id_rec`) and (`dr`.`det_pro` = `dp`.`det_pro`) and (`dp`.`cla_pro` = `p`.`cla_pro`) and (`dp`.`id_ori` = `o`.`id_ori`) and (`p`.`cla_pro` = convert(`p_a`.`clave` using utf8)) and (`p`.`cla_pro` = convert(`cm`.`clave` using utf8)) and (`r`.`transito` = 0))) ;

-- ----------------------------
-- View structure for `recetas`
